import './App.css';
import Header from './Header.js'
import Banner from './Banner.js'
import CreateOrder from './CreateOrder.js'
import Footer from './Footer.js'


function App() {
  return (
    <div className="App">

    <Header />
    <Banner />
    <CreateOrder />
    <Footer />
    </div>
  );
}

export default App;
